import React from 'react';

const NotFound = () => {
  return (
    <div className="p-6">
      <h1 className="text-2xl font-bold mb-4">404 - Seite nicht gefunden</h1>
      <p>Die angeforderte Seite existiert nicht.</p>
    </div>
  );
};

export default NotFound;
